import { AppThunk } from '../../store';
import { tryCreateUserFailled, tryCreateUserRequest, tryCreateUserSuccess } from './usersSlice';

export const createUsers = (): AppThunk => async (dispatch) => {
  dispatch(tryCreateUserRequest());

  try {
    dispatch(tryCreateUserSuccess({ id: Math.random().toString(16), title: 'User 2' }));
  } catch (error) {
    dispatch(tryCreateUserFailled(''));
    throw error;
  }
};
